import BaseLayout from '../components/layouts/BaseLayout';
import axios from 'axios';
import Link from 'next/link';


class Cv extends React.Component{

	render() {
		const Articles = [
		"one",
		"two",
		"three"
		].map((titleval, i) => <h3 key={i}/>);
		return(
	  	 <BaseLayout>
		  	<h1>New CV Page</h1>
		  	<div>
		  		<h3>{ titleval }</h3>
		  		<p>hiii</p>
		  	</div>
	  	</BaseLayout>
	  	)
	}
}
export default Cv;
